mapper.select:

select 

from RMINE
where RMINE_TXDATE = #{rmineTxdate,jdbcType=CHAR}
  and RMINE_BRNO = #{rmineBrno,jdbcType=CHAR}
  and RMINE_FEPNO = #{rmineFepno,jdbcType=CHAR}
  and RMINE_FEPSUBNO = #{rmineFepsubno,jdbcType=CHAR}

mapper.delete:

delete from RMINE
where RMINE_TXDATE = #{rmineTxdate,jdbcType=CHAR}
  and RMINE_BRNO = #{rmineBrno,jdbcType=CHAR}
  and RMINE_FEPNO = #{rmineFepno,jdbcType=CHAR}
  and RMINE_FEPSUBNO = #{rmineFepsubno,jdbcType=CHAR}
